import React from "react";

import Layout from "../src/components/Layout";
import PhoneDashboardPage from "../src/components/PhoneDashboardPage";

const Index = () => {
  return (
    <>
      <PhoneDashboardPage />
      <style jsx>
        {`
          @media screen and (max-width: 600px) {
            body {
              display: none;
            }
          }
        `}
      </style>
    </>
  );
};

export default Index;
